import './App.css';
import Homepage from './pages/homepage';
import MissionPage from './pages/about/mission.page';
import Compliance from './pages/about/compliance.page';
import Faqs from './pages/about/faqs.page';
import CompetitiveAdvantages from './pages/about/competitive-advantages.page';
import TeamPage from './pages/about/team.page';
import ContactUsPage from './pages/about/contactus.page';
import AdministrativeSupportPage from './pages/services/administrative-support.page';
import FinanceAccountingPage from './pages/services/finance-accounting.page';
import HumanResourcesPage from './pages/services/human-resources.page';
import Behavioralhealthcare from './pages/services/behavioral-healthcare.page';
import HealthcareSupportPage from './pages/services/healthcare-support.page';
import InformationTechnologyPage from './pages/services/information-technology.page';
import PayrollPage from './pages/growth/payroll.page';
import ContractorPage from './pages/growth/contractor.page';
import StaffTypesPage from './pages/seeker/staff.page';
import JobSearchPage from './pages/seeker/job-search.page';
import EmployeeRecognitionProgramPage from './pages/seeker/employee-recognition.page';
import SubmitResumePage from './pages/seeker/submit-resume.page';

import {
  Switch,
  Route, 
} from "react-router-dom";

function App() {
  return (
    <div className="App">

      <Switch>
        <Route exact path="/"  component={Homepage} />
        <Route exact path="/our-mission"  component={MissionPage} />
        <Route exact path="/compliance-is-our-focus"  component={Compliance} />
        <Route exact path="/faqs"  component={Faqs} />
        <Route exact path="/competitive-advantages"  component={CompetitiveAdvantages} />
        <Route exact path="/our-team"  component={TeamPage} />
        <Route exact path="/contact-us"  component={ContactUsPage} />
        <Route exact path="/administrative-support"  component={AdministrativeSupportPage} />
        <Route exact path="/finance-accounting"  component={FinanceAccountingPage} />
        <Route exact path="/human-resources"  component={HumanResourcesPage} />
        <Route exact path="/behavioral-healthcare"  component={Behavioralhealthcare} />
        <Route exact path="/healthcare-support"  component={HealthcareSupportPage} />
        <Route exact path="/information-technology"  component={InformationTechnologyPage} />
        <Route exact path="/third-party-payroll-solutions"  component={PayrollPage} />
        <Route exact path="/1099-independent-contractor-compliance"  component={ContractorPage} />
        <Route exact path="/types-of-staffing"  component={StaffTypesPage} />
        <Route exact path="/job-search"  component={JobSearchPage} />
        <Route exact path="/employee-recognization-program"  component={EmployeeRecognitionProgramPage} />
        <Route exact path="/submit-your-resume"  component={SubmitResumePage} />
      </Switch>

    </div>
  );
}

export default App;
